pragma solidity >0.4.24;

import "./TextResolver.sol";

contract TextResolverMock is TextResolver {
    mapping(bytes32=>mapping(string=>string)) texts;

    event TextChanged(bytes32 indexed node, string indexed indexedKey, string key);
    /**
     * Sets the text data associated with an ENS node and key.
     * May only be called by the owner of that node in the ENS registry.
     * @param node The node to update.
     * @param key The key to set.
     * @param value The text data value to set.
     */
    function setText(bytes32 node, string memory key, string memory value) public authorised(node) {
        texts[node][key] = value;
        emit TextChanged(node, key, key);
    }

    function text(bytes32 node, string memory key) public view returns (string memory) {
        return texts[node][key];
    }

    modifier authorised(bytes32 node) {
        require(isAuthorised(node));
        _;
    }

}

